    <div>
      <h1>Hello there this is login page</h1>

      <form action="" class="form-box" method="POST">
        <h2 class="name">Chatzzz</h2>

        <div id="login">
          <a class="login-a">Register</a>
        </div>
      </form>
    </div>
  );
}

export default Login;
